import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import './Home.css';

export default function Home() {
  return (
    <div id="Home" className="tabcontent">
      <Container>
        <Row className="home-content">
          {/* Left column with image */}
          <Col md={4} className="home-column">
            <div className="home-image">
              <img src="../public/img/background.jpg" alt="Image 1" />
            </div>
          </Col>

          {/* Middle column with text */}
          <Col md={4} className="home-column">
            <div className="home-text">
              <h2>Welcome to Our Website</h2>
              <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam condimentum metus eget ipsum imperdiet, et volutpat mi mollis.</p>
              <p>Nulla fringilla urna vitae leo euismod dapibus. Integer commodo nulla vel risus euismod eleifend.</p>
            </div>
          </Col>

          {/* Right column with image */}
          <Col md={4} className="home-column">
            <div className="home-image">
              <img src="/path/to/your/image2.jpg" alt="Image 2" />
            </div>
          </Col>
        </Row>
      </Container>
    </div>
  );
}
